testData.forEach(function(testElement)
{
    try
    {
        var astId = 0;

        FBL.Firecrow.ASTHelper.traverseAst(testElement, function(propertyValue, propName, parentElement)
        {
            propertyValue.astId = stringifyId(astId); //6 znamenkasti string -> "1 - 000001"
            astId++;

            propertyValue.dataDependencies = [];
            propertyValue.structuralDependencies = [];

            for(var i = 0; i < 3; i++)
            {
                propertyValue.dataDependencies.push("astElement" + stringifyId(getRandomInteger(0, 50)));
                propertyValue.structuralDependencies.push("astElement" + stringifyId(getRandomInteger(0, 50)));
            }

//            console.log("astElement" + propertyValue.astId + " | type: " + propertyValue.type);
//            console.log(propertyValue.dataDependencies);
//            console.log(propertyValue.structuralDependencies);
        });
    }
    catch(e) { alert("Error when traversing ast in testData.js: " + e);}
});


function stringifyId(curId)
{
	if(curId < 0) alert("Invalid AST Identification: ID cannot be negative (Source: testData.js)");
	if(curId > 999999) alert("Invalid AST Identification: ID exceeds, but is limited to,  6 characters (Source: testData.js)");
	return ("00000" + curId).slice(-6);
}
